import React from "react";

const Instagram = () => {
  return (
    <div className="instagram-section">
      <div className="instagram-section-phrase"></div>
      <div className="instagram-section-image"></div>
      <div className="instagram-section-hashtag"></div>
      <button className="instagram-section-button"></button>
    </div>
  );
};

export default Instagram;
